import React from 'react';
import Header from './Header';

const Footer = () => {
  return (
    <div>
      <h4>Halaman Footer</h4>
      <p>@2018</p>
    </div>
  );
}

function App() {
  return (
    <div>
      <Header />
      <h1>Renderng Elements</h1>
    </div>
  );
}

export default App;
